import React, { Component } from 'react';
import Select from 'react-select';

const tempOptions = [
  { label: "Any", value: 0 },
  { label: "Accounting/Finance", value: 1 },
  { label: "Agriculture", value: 2 },
  { label: "Art/Design", value: 3 },
  { label: "Project Management", value: 4 },
  { label: "Software Engineering", value: 5 },
];

const sortOptions = [
  { label: "Deadline (Earliest)", value: 0 },
  { label: "Deadline (Lastest)", value: 1 },
  { label: "Popularity", value: 2 },
];

export default class Filter extends Component {
  state = {
  }

  render () {
      return (
        <div>
          <label className="filter-label">Order</label>
          <Select
            options={sortOptions}
            className="filter-dropdown"
            defaultValue={sortOptions[0]}
            theme={theme => ({
             ...theme,
             borderRadius: "8px",
             colors: {
               ...theme.colors,
               primary25: '#eeeeee',
               primary: '#3d5afe',
               primary50: '#e8e8e8',
             },
           })}>
          </Select>
          </div>
        )
    }
}
